import { useState } from "react";

export default function Stable(){
    const [url,setUrl] = useState("");
    const { Configuration, OpenAIApi } = require("openai");
    const configuration = new Configuration({
        apiKey: "gO3g7smmRR1KxjKPYJpQT3BlbkFJMvjoDr87rpDWf0XGMn67",
    });
    const sendPrompt = async () =>{
        const openai = new OpenAIApi(configuration);
        const response = await openai.createImage({
          prompt: "A cute baby sea otter",
          n: 2,
          size: "1024x1024",
        });
        const image_url = response['data']['data'][0]['url'];
        setUrl(image_url);
    }

    return (
        <>
        <div className="mx-auto w-full max-w-screen-md px-4 pt-0 pb-2 flex">
          <textarea className="border rounded-md text-lg p-2 flex-1" rows={1}placeholder="Type your query" />
          <button className="border rounded-md bg-blue-500 hover:bg-blue-600 text-white px-4 ml-2">Click</button>
        </div>
        </>
    );
}
